
import ProductsServiceApi from "@/api/client/products"
import * as React from "react"


import {
  Card,
  CardContent,
  CardDescription,
  CardHeader,
  CardTitle,
} from "@/components/ui/card"
import Image from "next/image"
import { handelErorr } from "@/utils"

export default async function ShopPage() {
  try {
    const products = await ProductsServiceApi.getList({ limit: 10 })
    return (
      <div className="   grid grid-cols-4 gap-4 ">
        {
          products.map(product => {
            return (
              <Card className=" divide-x-2 border-gray-500" key={product.id}>
                <CardHeader>
                  <div className=" flex justify-center p-2">
                    <Image src={product.image} alt={product.title}
                      width={200}
                      height={200}
                      className=" w-[200px] h-[200px]"
                      placeholder="blur"
                      blurDataURL="data:image/jpeg;base64,"

                    />
                  </div>
                  <CardTitle>{product.title}</CardTitle>
                  <p>{product.price}$</p>
                  <CardDescription>{product.description}</CardDescription>

                </CardHeader>
                <CardContent>
                </CardContent>
              </Card>
            )
          })
        }
      </div>
    )

  } catch (error) {
    const err = handelErorr(error)
    throw Error(err.errors[0])
  }
}


